import InputControl from "./components/InputControl";
import UserInputControl from "./components/UserInputControl";
import { Form } from "react-bootstrap";
import FilesInDisplay from "./components/FilesInDisplay";
import Wizard from "./components/Wizard";

const App = () => {
  return (
    <div className="main">
      <h1> React AutoSuggestion Demo</h1>
      <Wizard />
      <div className="search-form">
        <FilesInDisplay />
        <Form>
          <InputControl
            name="country"
            label="Enter Country"
            placeholder="type a country name"
          />
        </Form>
        <UserInputControl id="uder-details" />
      </div>
    </div>
  );
};

export default App;
